import React from "react";
import { AppLoading, Asset, Font } from "expo";
import { StyleSheet, Text, View, Platform } from "react-native";

import { createStackNavigator } from "@react-navigation/stack";

import ApiKeys from "./src/firebase/APIKeys";
import * as firebase from "firebase";

const Stack = createStackNavigator();
// const firebase = require("firebase/app");
// require("firebase/analytics");

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoadingComplete: false,
      isAuthenticationReady: false,
      isAuthenticated: false,
    };

    if (!firebase.apps.length) {
      firebase.initializeApp(ApiKeys.FirebaseConfig);
      // firebase.analytics.isSupported().then((isSupported) => {
      //   if (isSupported) {
      //     analytics = firebase.analytics();
      //   }
      // });
    }
    firebase.auth().onAuthStateChanged(this.onAuthStateChanged);
  }

  onAuthStateChanged = (user) => {
    this.setState({ isAuthenticationReady: true });
    this.setState({ isAuthenticated: !!user });
  };

  render() {
    if (
      (!this.state.isLoadingComplete || !this.state.isAuthenticationReady) &&
      !this.props.skipLoadingScreen
    ) {
      console.log("if statement");
      return (
        <AppLoading
          startAsync={this._loadResourcesAsync}
          onError={this._handleLoadingError}
          onFinish={this._handleFinishLoading}
        />
      );
    } else {
      console.log("else world!!");
      return (
        // <View><Text>Hello There!</Text></View>
        <View style={styles.container}>
          <Text style={{ paddingTop: 20 }}>Hello There!</Text>
          {Platform.OS === "ios" && <StatusBar barStyle="default" />}
          {Platform.OS === "android" && (
            <View style={styles.statusBarUnderlay} />
          )}
          {this.state.isAuthenticated ? (
            <MainTabNavigator />
          ) : (
            <RootNavigation />
          )}
        </View>
      );
      // <NavigationContainer>
      //   <Stack.Navigator>
      //     <Stack.Screen
      //       name="Home"
      //       component={HomeScreen}
      //       options={{ title: "Supersizers" }}
      //     />
      //     <Stack.Screen name="Quest" component={QuestScreen} />
      //     <Stack.Screen name="Nutritional" component={NutritionalScreen} />
      //   </Stack.Navigator>
      // </NavigationContainer>;
    }
  }
  _loadResourcesAsync = async () => {
    return Promise.all([
      Asset.loadAsync([
        // require("./assets/images/robot-dev.png"),
        // require("./assets/images/robot-prod.png"),
      ]),
      Font.loadAsync({
        // This is the font that we are using for our tab bar
        // ...Ionicons.font,
        // We include SpaceMono because we use it in HomeScreen.js. Feel free
        // to remove this if you are not using it in your app
        // "space-mono": require("./assets/fonts/SpaceMono-Regular.ttf"),
      }),
    ]);
  };

  _handleLoadingError = (error) => {
    // In this case, you might want to report the error to your error
    // reporting service, for example Sentry
    console.warn(error);
  };

  _handleFinishLoading = () => {
    this.setState({ isLoadingComplete: true });
  };
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
  },
  statusBarUnderlay: {
    height: 24,
    backgroundColor: "rgba(0,0,0,0.2)",
  },
});
// export default App;
